// Ajusta la ruta según el output real de la API
const urlOrBase64 = $input.first().json.choices?.[0]?.message?.images?.[0]?.image_url?.url;

if (!urlOrBase64) {
  throw new Error('No se encontró URL/base64 en la respuesta');
}

let buffer;
let ext = 'png';
let contentType = '';

if (typeof urlOrBase64 === 'string' && urlOrBase64.startsWith('data:')) {
  // data URL: data:<mime>;base64,<data>
  const match = urlOrBase64.match(/^data:(image\/[a-zA-Z0-9.+-]+);base64,(.+)$/);
  if (!match) throw new Error('Data URL no tiene formato esperado');
  contentType = match[1];
  const b64 = match[2];
  buffer = Buffer.from(b64, 'base64');
  ext = (contentType.split('/')[1] || 'png').split(';')[0];
} else if (typeof urlOrBase64 === 'string' && /^https?:\/\//i.test(urlOrBase64)) {
  // Remote URL: descargar
  const res = await fetch(urlOrBase64);
  if (!res.ok) throw new Error(`Error al descargar la imagen: ${res.status} ${res.statusText}`);
  const arrayBuffer = await res.arrayBuffer();
  buffer = Buffer.from(arrayBuffer);
  contentType = res.headers.get('content-type') || '';
  if (contentType.startsWith('image/')) {
    ext = (contentType.split('/')[1] || 'png').split(';')[0];
  } else {
    // intenta inferir por la url
    const m = urlOrBase64.match(/\.([a-zA-Z0-9]+)(?:\?|$)/);
    if (m) ext = m[1].toLowerCase();
  }
} else {
  // Asumimos base64 puro
  // Limpiamos posibles comillas o espacios
  const cleaned = urlOrBase64.trim().replace(/^"|"$/g, '').replace(/^'|'$/g, '');
  try {
    buffer = Buffer.from(cleaned, 'base64');
    // opcional: validar que realmente sea imagen (primeros bytes)
    // dejamos ext = png por defecto
  } catch (e) {
    throw new Error('La cadena proporcionada no es Base64 válida');
  }
}

// Nombre de archivo seguro
const filename = `image.${ext.replace(/[^a-z0-9]/gi, '').toLowerCase() || 'png'}`;

// Devolver como binary para el siguiente nodo Telegram (Send Photo)
return [{
  json: {},
  binary: {
    file: await this.helpers.prepareBinaryData(buffer, filename)
  }
}];

// Function node: prepara el prompt que se enviará al modelo (ChatGPT) para crear un prompt de imagen creativa y FOTORREALISTA
function createPromptInitial() {
  // En el entorno original $input.first().json apunta al primer elemento del array que muestras
  const cg = ($input && $input.first && $input.first().json && $input.first().json.contenido_generado) || {};

  const titulo = (cg.titulo || '').toString().trim();
  const producto = (cg.producto_destacado || '').toString().trim();
  const copy = (cg.copy_publicacion || '').toString().trim();
  const hashtags = (Array.isArray(cg.hashtags) ? cg.hashtags.join(' ') : (cg.hashtags || '')).toString().trim();
  const tono = (cg.tono_aplicado || '').toString().trim();
  const emojis = (Array.isArray(cg.emojis_utilizados) ? cg.emojis_utilizados.join(' ') : (cg.emojis_utilizados || '')).toString().trim();
  const cta = (cg.llamado_accion || '').toString().trim();
  const plataforma = (cg.plataforma || '').toString().trim();
  const fecha = (cg.fecha || '').toString().trim();
  const negocio = (cg.negocio_id || '').toString().trim();

  // Prompt que enviaremos a ChatGPT para que genere un prompt de imagen fotorrealista y detallado + 3 variantes
  // ... (código previo)

  // Prompt que enviaremos a ChatGPT para que genere un prompt de imagen fotorrealista y detallado + 3 variantes
  const promptInitial = `
Eres un director/a de arte y prompt engineer experto/a en publicidad. Transforma la información de una publicación en un PROMPT DE IMAGEN fotorrealista, fotográfico y listo para usar en generadores como Midjourney / Stable Diffusion / DALL·E.

INSTRUCCIONES:
- Devuelve SOLO texto plano (sin JSON, sin explicaciones, sin comillas, sin etiquetas adicionales).
- La imagen debe ser 100% REALISTA (fotográfica). PROHIBIDO: estilo dibujo, anime, cómic, caricatura, vector, low-poly, ilustración, 3D render, CGI.
- Primero, genera un prompt principal en español (40–120 palabras) que incluya:
  • Escena concreta y sujeto principal (usa el producto destacado como foco). 
  • Elementos secundarios en contexto realista.
  • Composición y encuadre (regla de tercios/centrado, plano, perspectiva), sensación de escala.
  • Estilo fotográfico publicitario (editorial, lifestyle, producto en set, bodegón, beauty, etc.) y nivel de realismo (fotorrealismo, calidad de estudio).
  • Iluminación específica y creíble (tipo de luz: suave/difusa/dura; dirección: lateral/contraluz; esquema: key/rim/fill; hora del día/temperatura en K).
  • Cámara/óptica: tipo de lente y distancia focal en mm (p. ej., 35mm, 50mm, 85mm), apertura aproximada (p. ej., f/1.8–f/5.6) y profundidad de campo.
  • Texturas y materiales (superficies, reflejos, acabado), detalles de primer plano, nitidez, grano bajo.
  • Paleta de 3–5 colores en HEX integrados en la escena (ej.: #FFDAB9, #0F172A...).
  • Ambiente/mood coherente con el tono.
  • Sugerir un aspect ratio apropiado para la plataforma indicada (ej.: --ar 4:5 para Instagram feed; 1:1 cuadrado; 9:16 para Stories/Reels/TikTok; 16:9 para Facebook; 1.91:1 para LinkedIn), o propone el más conveniente si no hay plataforma.
- Usa los 'DATOS DE LA PUBLICACIÓN' solo como inspiración visual y de tono.
- Añade al final una línea "NEGATIVE:" con 6–8 elementos a evitar: texto sobreimpreso, logos ajenos, marca de agua, caricatura/ilustración/3D/CGI, baja resolución, artefactos, manos/ojos deformes, composiciones confusas.
- Después del prompt principal, incluye 3 VARIANTES cortas (cada una 20–25 palabras), siempre fotorrealistas, con enfoques alternativos (p. ej., iluminación dorada al atardecer, close-up macro de producto, entorno lifestyle en interior con luz de ventana).
- Mantén el idioma: español. No uses emojis, hashtags ni URLs en el prompt de imagen.

DATOS DE LA PUBLICACIÓN (inspírate sin copiar como texto en la imagen):
- Título: ${titulo}
- Producto destacado: ${producto}
- Copy / Mensaje: ${copy}
- Hashtags: ${hashtags}
- Tono aplicado: ${tono}
- Emojis: ${emojis}
- Llamado a la acción: ${cta}
- Plataforma: ${plataforma}
- Fecha de publicación: ${fecha}
- Negocio / Marca: ${negocio}

REQUISITOS ADICIONALES:
- El prompt principal debe ser evocador, concreto y accionable (40–120 palabras).
- Incluye 3–5 colores en formato HEX integrados naturalmente en la escena.
- Sugiere claramente el aspect ratio ideal según la plataforma indicada (Instagram: 4:5 o 1:1; Facebook: 16:9 o 4:5; Stories/Reels/TikTok: 9:16; LinkedIn: 1.91:1; Pinterest: 2:3). Si la plataforma no está clara, elige el más conveniente para publicidad de producto.
- Proporciona una línea NEGATIVE: con 6–8 ítems separados por comas.
- Genera la mejor frase llamativa para superponer en la imagen (máximo 8 palabras) y colócala después de las variantes.
- Luego genera:
  VARIANTE 1: ...
  VARIANTE 2: ...
  VARIANTE 3: ...
- La respuesta debe terminar con la línea **FRASE PUBLICITARIA:** seguida de la frase.

RESPONDE AHORA con:
1) Prompt principal listo para el modelo de imagen.
2) Línea NEGATIVE: ...
3) VARIANTE 1: ...
   VARIANTE 2: ...
   VARIANTE 3: ...
4) FRASE PUBLICITARIA: ...
Nada más.
`.trim();

  return { prompt: promptInitial };
}

